 void solve(){
  ll n,m,k;
  cin>>n>>m>>k;
  vector<ll>v(n),v1;
  cin(v);
  v1=v;
  sort(all(v));
  map<ll,ll>mp;
  ll l=0,r=1e9,ans=-1,counter=1,d=0,idx=0,temp=v[0],res=-1;
  for(int i=0;i<v.size();i++){
    if(i==0){
      mp[v[i]]=counter;
    }else{
      if(v[i]-temp>k){
        counter=1;
        mp[v[i]]=counter;
        temp=v[i];
        d=i-idx;
        ans=max(ans,d);
        idx=i;
      }else{
        counter++;
        mp[v[i]]=counter;
        continue; 
      }
    }
  }
  while(l<=r){
    ll mid=l+(r-l)/2;
    if(mid>=ans){
      res=mid;
      r=mid-1;
    }else{
      l=mid+1;
    }
  }
  cout<<res<<"\n";
  v=v1;
  for(int i=0;i<n;i++){
    cout<<mp[v[i]]<<" ";
  }
 }

