#include <bits/stdc++.h>
#define int long long
using namespace std;
vector<int> powers(int p, int n, int mod){
    vector<int> q(n+1);
    q[0]=1;
    for (int i=1; i<=n; i++){
        q[i]=q[i-1]*p;
        q[i]%=mod;
    }
    return q;
}

vector<int> hash_function(int p, int mod, string s){
